# Time: O(n log n for n edges) (like dijkstra: for each node, select min next node)
# Space: O(e) (possible nodes have a edge to each other node)


# tricks: apply a min heap to the queue
# use dijkstras
# maintain an ongoing distance traversed pty queue as well as the vertex; you select the min from it (minheap) in order to maximize nodes traversed
# you keep track of nodes you can hit with visited on each node; you also track subnodes visited:
# if its full, then subnodes[{u,v}] = w
# if its not full, then [(u,v)] = partial, num of moves you have available at that turn; 
# num moves = max moves - dist traversed 
# you only add to queue if you have enough moves, i.e. moves >= w + 1
# at the end to calculate total nodes able to be traversed: 
#   - sum all nodes traversed = sum(visited)
#   - sum all subnodes traversed: for each edge = (u,v,w), you can either get all of them or partial i.e. from one u>v or v<u or both; if they 
#       overlap, then you cap max at w; so: for each edge = (u,v,w), count_to_add = min(w, subnodes[(u,v)] + subnodes[(v,u)]) 


