def reachableNodes(edges, maxMoves, n):
    visited = [False] * n
    graph = defaultdict(defaultdict)
    subnodes = defaultdict(int)                     # (u,v,n) from u to v, gets n subnodes 
    for (u,v,w) in edges: 
        graph[u][v] = graph[v][u] = w

    print(graph)
    q = []                                          # priority queue
    heappush(q, (0, 0))                             # (dist, vertex); start at 0 with a dist of 0
    
    while q:                                        # calculate moves = maxMoves - 
        (dist, u) = heappop(q)                      #
        if visited[u]: 
            continue
        visited[u] = True
        moves = maxMoves - dist                     # represents how many moves you can make for the next v
        for v in graph[u]:                          # to be able to traverse, moves >= w + 1
            w = graph[u][v]                         # check if you can traverse to v
            subnodes[(u, v)] = min(w, moves)
            if moves >= w + 1 and not visited[v]: 
                heappush(q, (dist + w + 1, v))


    res = sum(visited)
    for (u,v,w) in edges:
        res += min(w, subnodes[(u,v)] + subnodes[(v,u)]) 
    return res

